import React, { Component } from 'react';
import './App.css';
import PropTypes from 'prop-types';
import { withStyles } from '@material-ui/core/styles';
import Paper from '@material-ui/core/Paper';
import Grid from '@material-ui/core/Grid';
import SelectProcessor from "./selectprocessor";
import SelectUsage from "./selectusage";
import SelectPref from "./selectpreference";
import Btn from "./search";
import SelectLaptopBudget from "./lapbudget";
import CircularProgress from '@material-ui/core/CircularProgress';

const styles = theme => ({
  root: {
    flexGrow: 1,
  },
  paper: {
    padding: theme.spacing.unit * 2,
    textAlign: 'center',
    color: theme.palette.text.secondary,
  },
});


function CircularUnderLoad() {
  return <CircularProgress disableShrink />;
}




function CenteredGrid(props) {
	const { classes } = props;

  return (
    <div className={classes.root}>
      <br/>	
       <Grid container spacing={12}>
        	<Grid item xs={1}></Grid>
        	<Grid item xs={10}>
          		<Paper className={classes.paper}><b><h1>LAPTOP-MOBILE FINDER</h1></b></Paper>
        	</Grid>

        	<Grid item xs={1}></Grid>
       </Grid>
       <br/>

       <Grid container spacing={12}> 
       <Grid item xs={1}></Grid>
       <Grid item xs={5}>
          <Paper className={classes.paper}>


          	<h2>Laptop's</h2>
          	<br/>
          	<Grid container spacing={12}>
          		<Grid item xs={4}>
          			<SelectProcessor/>
          		</Grid>

          		<Grid item xs={4}>
          			<SelectUsage/>
          		</Grid>

          		<Grid item xs={4}>
          			<SelectPref/>
          		</Grid>	
          	</Grid>

          	<SelectLaptopBudget/>
          	<br/>
          	<Btn onClick={this.CircularUnderLoad}/>

          </Paper>
        </Grid>
       <Grid item xs={5}>
          <Paper className={classes.paper}>
          	<h2>Mobile's</h2>

          </Paper>
       </Grid>
       <Grid item xs={1}></Grid>

   		</Grid>
    </div>
  );
}


CenteredGrid.propTypes = {
  classes: PropTypes.object.isRequired,
};

export default withStyles(styles)(CenteredGrid);
